❗️Kłamco i oszuście, lepiej napisz o machlojkach, nieprawidłowościach w kampanii @trzaskowski_, o których było głośno!!

A jak wezmą się we właściwym czasie za źródła finansowania troli ze #Snaw to trafisz za kratki!!

